    [],nt"revision_timestamp": "2016-07-27T22:20:48.354685",nt"name": "remote-and-roadside-lake-study-1983",nt"isopen":
    false,nt"url": null,nt"notes": "Personnel of the U.S. Fish and Wildlife
    Service, Kenai Fishery Resources Station, conducted fishery surveys on 18 remote
    and roadside lakes of the Kenai National Wildlife Refuge from June 1 to October
    7, 1983.  The objective of the study is to evaluate selected Kenai NWR lakes for
    their real and potential contribution to recreational fisheries. To achieve this
    objective, information on fish, plus related water quality, physical characteristics,
    vegetation, and wildlife were ascertained. The intent was to survey as many lakes
    as possible over a short period, while at the same time, providing a reliable picture
    of the lake's fishery status.",nt"license_title": "License Not Specified",nt"extras":
